  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes bathymetry of the
  sea floor offshore of eastern Cape Cod, Massachusetts. The data were collected with
  a multibeam sea floor mapping system during USGS survey 98015, conducted November
  9 - 25, 1998. The surveys were conducted using a Simrad EM 1000 multibeam echosounder
  mounted aboard the Canadian Coast Guard vessel Frederick G. Creed. This multibeam
  system utilizes 60 electronically aimed receive beams spaced at intervals of 2.5
  degrees that insonify a strip of sea floor up to 7.5 times the water depth (swath
  width of 100 to 200 m within the survey area). The horizontal resolution of the
  beam on the sea floor is approximately 10% of the water depth. Vertical resolution
  is approximately 1 percent of the water depth.\",\n\t\"license_title\": null,\n\t\"extras\":
